import React from 'react'
import {data} from "../../store/store";
import s from "./Product.module.css"

class Product extends React.Component{
    constructor (){
        super();

        this.state = {
            willBuy: false
        }
    }

    render() {
        return (
            <div className={s.containerProduct} >
                <div>{this.props.el.title} </div>
                <img src={this.props.el.image_main}  alt="ddd"/>

                <div>
                    <div>
                        {this.state.willBuy
                            ?
                            (<button className={s.addCart} onClick={this.state={ willBuy: true}}>Remove Will Buy</button>)
                            :
                            ((<button className={s.addCart} onClick={this.props.productToWillBuy.bind(null, this.props.el)}>Add Will Buy</button>))}

                    </div>

                    <button className={s.delete} onClick={this.props.removeElement.bind(null, this.el)}>
                        Delete
                    </button>
                </div>
            </div>
        );
    }
}



export default Product;
